import firebase from 'firebase';

var firebaseConfig = {
    apiKey:process.REACT_APP_API_KEY,
    authDomain: "information-hub-289110.firebaseapp.com",
    projectId: "information-hub-289110",
    storageBucket: "information-hub-289110.appspot.com",
    messagingSenderId: "1019101275795",
    appId: "1:1019101275795:web:15d326ca59928684f50f66"
  };
 // Initialize Firebase
 firebase.initializeApp(firebaseConfig);

 export default firebase;
